import os
import h5py
import bbi
import logging
import subprocess
import numpy as np
import pandas as pd

from pathlib import Path
from _BioDataset import BioH5Dataset

from typing import Any, Callable, Dict, List, Optional, Tuple, Union

class RoadmapEpigenomics(BioH5Dataset):
    """
    Assemble Roadmap Epigenomics Dataset : 
    1. download 723 Roadmap Epigenomics bigwig", files
    2. resolve the track in a specific resolution
    3. encapsulate all the track into a table
    4. compress the table to h5 file
    """
    def __init__(
        self, 
        h5_path: Union[str, Path], 
        raw_path: Union[str, Path], 
        resolution: int,
        logger = logging.getLogger(os.getcwd()),
        force_download = False,
        rebuild_h5 = False,
    ) -> None:
        super().__init__(h5_path, raw_path, logger, force_download, rebuild_h5)
        self.resolution = resolution

    def __getitem__(self, index) -> Any:
        return super().__getitem__(index)
    
    def __len__(self):
        pass
    
    def _raw2df(self, fpath):
        bin = -1
        with bbi.open(fpath) as epig_fd :
            epig_df = None

            for chm,L in epig_fd.chromsizes.items():
                self.logger.info(f"{chm}, length {L}")
                if self.resolution > 0:
                    bin = np.ceil(L/self.resolution).astype(int)
                
                if epig_df is None:
                    epig_df = epig_fd.fetch(chm, 0, L, bin=bin)
                else:
                    epig_df = pd.concat([epig_df, epig_fd.fetch(chm, 0, L, bin=bin)])

    def build_h5(self):
        h5_mode = 'w'
        self.logger.info(f"Building Roadmap Epigenomics H5 Dataset [{self.h5_path}]")
        for fpath in os.listdir(self.raw_path):
            fpath = self.raw_path.joinpath(fpath)
            if os.path.isfile(fpath):
                self.logger.info(f"    raw data: {fpath}")
                if os.path.isfile(self.h5_path):
                    h5_mode = 'a'
                with h5py.File(self.h5_path, h5_mode) as h5fd:
                    name = fpath.name.split('.')[0]
                    self.logger.info(f"write Roadmap Epigenomics dataset {name} to h5 file")
                    h5fd.create_dataset(name = name, data = self._raw2df(fpath))

